import React from 'react';
import {Routes, Route, Navigate, BrowserRouter} from 'react-router-dom'
import {authRoutes, publicRoutes} from "../routes";

const AppRouter = () => {
    const isAuth = false
    return (
        <Routes>
            {isAuth === true && authRoutes.map(({path, Elements}) =>(<Route key={path} path={path} element={<Elements />}/>))}
            {publicRoutes.map(({path, Elements}) =>(<Route key={path} path={path} element={<Elements />}/>))}
        </Routes>
    );
};

export default AppRouter;
